    private final MockConnection conn;

    public MockQueryHandler(MockConnection conn) {
        this.conn = conn;
    }

    @Override
    public void query(String sql) {
        IPacketOutputProxy proxy = PacketOutputProxyFactory.getInstance().createProxy(conn);
        proxy.packetBegin();

        // header
        ResultSetHeaderPacket header = new ResultSetHeaderPacket();
        header.packetId = conn.getNewPacketId();
        header.fieldCount = 1;
        header.write(proxy);

        // fields
        FieldPacket[] fields = new FieldPacket[header.fieldCount];
        for (FieldPacket field : fields) {
            field = new FieldPacket();
            field.packetId = conn.getNewPacketId();
            field.charsetIndex = CharsetUtil.getIndex(conn.getCharset());
            field.name = encode("Result", conn.getCharset());
            field.type = Fields.FIELD_TYPE_VAR_STRING;
            field.write(proxy);
        }

        // eof
        EOFPacket eof = new EOFPacket();
        eof.packetId = conn.getNewPacketId();
        proxy = eof.write(proxy);

        String mockResult = sql;
        if (sql.indexOf("t_1K") >= 0) {
            mockResult = RESULT_1K;
        } else if (sql.indexOf("t_2K") >= 0) {
            mockResult = RESULT_2K;
        } else if (sql.indexOf("t_4K") >= 0) {
            mockResult = RESULT_4K;
        } else if (sql.indexOf("t_8K") >= 0) {
            mockResult = RESULT_8K;
        } else if (sql.indexOf("t_16K") >= 0) {
            mockResult = RESULT_16K;
        } else if (sql.indexOf("t_32K") >= 0) {
            mockResult = RESULT_32K;
        }

        // results
        RowDataPacket row = new RowDataPacket(header.fieldCount);
        row.add(encode(mockResult, conn.getCharset()));
        row.packetId = conn.getNewPacketId();
        proxy = row.write(proxy);

        // last eof
        EOFPacket lastEof = new EOFPacket();
        lastEof.packetId = conn.getNewPacketId();
        lastEof.status = 2;
        proxy = lastEof.write(proxy);

        // write buffer
        proxy.packetEnd();
    }

    private static byte[] encode(String src, String charset) {
        if (src == null) {
            return null;
        }

        charset = CharsetUtil.getJavaCharset(charset);
        try {
            return src.getBytes(charset);
        } catch (UnsupportedEncodingException e) {
            logger.warn("Unknown charset: " + charset, e);
            return src.getBytes();
        }
    }
